import React from 'react';

import * as Styled from './styles';

const SiteHeader = () => {
    return (
        <Styled.SiteHeaderContainer w={1} h={'60px'} alignItems={'center'}>
            <Styled.LogoText>COVID-19</Styled.LogoText>
        </Styled.SiteHeaderContainer>
    )
}

export default SiteHeader;
